import React from "react";

import {
  Card,
  ButtonGroup,
  Divider,
  Stack,
  CardBody,
  CardFooter,
  SimpleGrid,
  Heading,
  Text,
  Button,
  Image,
  CardHeader,
  Box,
} from "@chakra-ui/react";

const Proyectos = () => {
  return (
    <div className="Pag-header">
      Proyectos
      <SimpleGrid columns={2} spacingX="40px" spacingY="20px">
        <Box bg="tomato" height="80px"></Box>
        <Box bg="tomato" height="80px"></Box>
        <Box bg="tomato" height="80px"></Box>
        <Box bg="tomato" height="80px"></Box>
        <Box bg="tomato" height="80px"></Box>
      </SimpleGrid>
    </div>
  );
};

export default Proyectos;
